import React from "react";
import { useForm, ValidationError } from "@formspree/react";
import "./css/contact.css";
const Contact = () => {
  const [state, handleSubmit, reset] = useForm("mpzvllnp");
  const handleFormSubmit = async (event) => {
    await handleSubmit(event);
    if (state.succeeded) {
      alert("Message Sent!!!");
      reset(); // Reset the form after successful submission
    }
  };
  
 

  return (
    <>
    
      <div className="formhead">
        <h1>Get in <span className="light">Touch</span> Today!</h1>
      </div>
      <div className="formmain">
      
      <div className="contactimg1"></div>

        <form onSubmit={handleFormSubmit} className="formcontainer">
          <label htmlFor="name" className="formlabel">
            Name
          </label>
          <input id="name" type="text" name="name" className="inputfield" required/>
          <ValidationError prefix="Name" field="name" errors={state.errors} />
          <label htmlFor="email" className="formlabel">
            Email Address
          </label>
          <input id="email" type="email" name="email" className="inputfield" required/>
          <ValidationError prefix="Email" field="email" errors={state.errors} />
          <label htmlFor="message" className="formlabel">
            Message
          </label>
          <textarea id="message" name="message" className="inputfield" required/>
          <ValidationError
            prefix="Message"
            field="message"
            errors={state.errors}
          />
          <button type="submit" className="formbtn" disabled={state.submitting}>
            Submit
          </button>
        </form>
    <div className="contactimg2"></div>
      </div>
    </>
  );
};
export default Contact;
